import * as hethers from 'hethers/packages/hethers/lib/hethers.js';
import {
	TransferTransaction,
	AccountCreateTransaction,
	AccountBalanceQuery,
	TokenCreateTransaction,
	TokenAssociateTransaction,
	ContractId,
	PrivateKey,
	Hbar,
	Client,
	Key as HederaKey,
	ContractInfoQuery,
	TransactionId,
} from "@hashgraph/sdk";
import {Key} from "@hashgraph/proto";
import * as fs from 'fs';
import 'dotenv/config';

// main
(async () => {
	const network = {
		"127.0.0.1:50211": "0.0.3",
	};
	const provider = new hethers.providers.HederaProvider("0.0.3", "127.0.0.1:50211", "");
	const client = Client.forNetwork(network);
	client.setOperator(process.env.ACCOUNT_ID, process.env.PRIVATE_KEY);

	let aliceClientWallet = hethers.Wallet.createRandom();
	let aliceAccountKey = HederaKey._fromProtobufKey(Key.create({
		ECDSASecp256k1: hethers.utils.arrayify(aliceClientWallet._signingKey().compressedPublicKey)
	}));

	const aliceAccountCreate = await (await new AccountCreateTransaction()
		.setKey(aliceAccountKey)
		.setTransactionId(TransactionId.generate(process.env.ACCOUNT_ID))
		.setInitialBalance(new Hbar(200))
		.setNodeAccountIds([client._network.getNodeAccountIdsForExecute()[0]])
		.freeze()
		.sign(PrivateKey.fromString(process.env.PRIVATE_KEY)))
		.execute(client);
	const aliceReceipt = await aliceAccountCreate.getReceipt(client);
	const aliceAccount = aliceReceipt.accountId || "0.0.0";
	console.log(`Using Alice account ${aliceAccount}`);

	/**
	 * Connect Alice account
	 */
	aliceClientWallet = aliceClientWallet
		.connect(provider)
		.connectAccount(aliceAccount.toString());

	let bobClientWallet = hethers.Wallet.createRandom();
	let bobAccountKey = HederaKey._fromProtobufKey(Key.create({
		ECDSASecp256k1: hethers.utils.arrayify(bobClientWallet._signingKey().compressedPublicKey)
	}));

	const bobAccountCreate = await (await new AccountCreateTransaction()
		.setKey(bobAccountKey)
		.setTransactionId(TransactionId.generate(process.env.ACCOUNT_ID))
		.setInitialBalance(new Hbar(200))
		.setNodeAccountIds([client._network.getNodeAccountIdsForExecute()[0]])
		.freeze()
		.sign(PrivateKey.fromString(process.env.PRIVATE_KEY)))
		.execute(client);
	const bobReceipt = await bobAccountCreate.getReceipt(client);
	const bobAccount = bobReceipt.accountId || "0.0.0";
	console.log(`Using Bob account ${bobAccount}`);

	/**
	 * Connect Bob account
	 */
	bobClientWallet = bobClientWallet
		.connect(provider)
		.connectAccount(bobAccount.toString());

	const gasLimitOverride = {gasLimit: 3000000};

	// 3rd party
	const aliceClient = Client.forNetwork(network);
	aliceClient.setOperator(aliceAccount, aliceClientWallet._signingKey().privateKey);

	const bobClient = Client.forNetwork(network);
	bobClient.setOperator(bobAccount, bobClientWallet._signingKey().privateKey);

	var date = new Date();
	console.log(date)
	date.setDate(date.getDate() + 1);
	console.log(date)

	const alicePrivKey = PrivateKey.fromStringECDSA(aliceClientWallet._signingKey().privateKey);
	const bobPrivKey = PrivateKey.fromStringECDSA(bobClientWallet._signingKey().privateKey);

	const tokenContracts = [];
	for (let i = 1; i <= 2; i++) {
		const tokenName = process.env[`TOKEN${i}_NAME`];
		const tokenSymbol = process.env[`TOKEN${i}_SYMBOL`];
		const tokenSupply = process.env[`TOKEN${i}_SUPPLY`];

		const tokenCreate = await (await new TokenCreateTransaction()
			.setTokenName(tokenName)
			.setTokenSymbol(tokenSymbol)
			.setExpirationTime(date)
			.setDecimals(8)
			.setInitialSupply(tokenSupply)
			.setTreasuryAccountId(process.env.ACCOUNT_ID)
			.setTransactionId(TransactionId.generate(process.env.ACCOUNT_ID))
			.setNodeAccountIds([client._network.getNodeAccountIdsForExecute()[0]])
			.freeze()
			.sign(PrivateKey.fromString(process.env.PRIVATE_KEY)))
			.execute(client);
		const receipt = await tokenCreate.getReceipt(client);
		const tokenAddress = hethers.utils.getAddressFromAccount(receipt.tokenId);
		tokenContracts.push({evmAddress: tokenAddress, tokenId: receipt.tokenId});
		console.log('Deployed token contract for', tokenSymbol, 'at:', tokenAddress, receipt.tokenId);

		const tokenAssociateAlice = await (await new TokenAssociateTransaction()
			.setAccountId(aliceAccount)
			.setTokenIds([receipt.tokenId])
			.freezeWith(aliceClient)
			.sign(alicePrivKey))
			.execute(aliceClient);
		const associateAliceReceipt = await tokenAssociateAlice.getReceipt(aliceClient);

		const tokenAssociateBob = await (await new TokenAssociateTransaction()
			.setAccountId(bobAccount)
			.setTokenIds([receipt.tokenId])
			.freezeWith(bobClient)
			.sign(bobPrivKey))
			.execute(bobClient);
		const associateBobReceipt = await tokenAssociateBob.getReceipt(bobClient);

		const tokenTransfer = await (await new TransferTransaction()
				.addTokenTransfer(receipt.tokenId, process.env.ACCOUNT_ID, -100000000000)
				.addTokenTransfer(receipt.tokenId, aliceAccount, 100000000000)
				.freezeWith(client)
				.sign(alicePrivKey))
			.execute(client);
		const tokenTransferReceipt = await tokenTransfer.getReceipt(client);
	}

	const tokenTransfer = await (await new TransferTransaction()
		.addTokenTransfer(tokenContracts[0].tokenId, process.env.ACCOUNT_ID, -100000000000)
		.addTokenTransfer(tokenContracts[0].tokenId, bobAccount, 100000000000)
		.freezeWith(client)
		.sign(bobPrivKey))
		.execute(client);
	const tokenTransferReceipt = await tokenTransfer.getReceipt(client);

	const _uniswapV2FactoryBytecode = "";
	const _uniswapV2FactoryAbi = JSON.parse(fs.readFileSync('assets/abi/UniswapV2Factory.abi.json').toString());
	const _factoryContractFactory = new hethers.ContractFactory(_uniswapV2FactoryAbi, _uniswapV2FactoryBytecode, aliceClientWallet);

	// we will use our first token contract for WETH
	const deployeduniswapV2Factory = await _factoryContractFactory.deploy(hethers.constants.AddressZero, gasLimitOverride);
	const uniswapV2Factory = hethers.ContractFactory.getContract(deployeduniswapV2Factory.address, _uniswapV2FactoryAbi, aliceClientWallet);
	console.log('UniswapV2Factory address:', uniswapV2Factory.address);

	await uniswapV2Factory.createPair(tokenContracts[0].evmAddress, tokenContracts[1].evmAddress, gasLimitOverride);
	const pairAddress = await uniswapV2Factory.getPair(tokenContracts[0].evmAddress, tokenContracts[1].evmAddress, gasLimitOverride);
	console.log('Pair address:', pairAddress.toString());

	const pairGetInfo = await (await new ContractInfoQuery()
		.setContractId(ContractId.fromEvmAddress(0, 0, pairAddress)))
		.execute(client);
	console.log(pairGetInfo)

	const _uniswapV2RouterBytecode = "";
	const _uniswapV2RouterAbi = JSON.parse(fs.readFileSync('assets/abi/UniswapV2Router.abi.json').toString());
	const _routerContractFactory = new hethers.ContractFactory(_uniswapV2RouterAbi, _uniswapV2RouterBytecode, aliceClientWallet);

	// we will use our first token contract for WETH
	const WETH_ADDRESS = tokenContracts[0].evmAddress;
	const uniswapV2Router = await _routerContractFactory.deploy(uniswapV2Factory.address, WETH_ADDRESS, gasLimitOverride);
	console.log('UniswapV2Router address:', uniswapV2Router.address);

	// TODO: Investigate how to import bin files instead of hardcoding bytecodes
	// TODO: Approve spending tokens from router/factory, when functionality is ready

	const today = new Date();
	const oneHourAfter = new Date();
	oneHourAfter.setHours(today.getHours() + 1);

	try {
		console.log("Attempting to add liquidity.")
		// contract_revert -> was initial error when deadline was 0
		// fail_invalid -> appears when deadline is met. May either be about the timestamp or something internal after the code execution
		let reconnectedUniswapV2Router = hethers.ContractFactory.getContract(uniswapV2Router.address, _uniswapV2RouterAbi, aliceClientWallet);
		const liquidityAddTx = await reconnectedUniswapV2Router.addLiquidity(
			tokenContracts[0].evmAddress,
			tokenContracts[1].evmAddress,
			100000000000,
			100000000000,
			100000000000,
			100000000000,
			aliceClientWallet.address,
			oneHourAfter.getTime(),
			gasLimitOverride);
		console.log('Waiting for liquidityAddTx');

		console.log(liquidityAddTx)

		const reserves = await reconnectedUniswapV2Router.getReserves(
			tokenContracts[0].evmAddress,
			tokenContracts[1].evmAddress,
			gasLimitOverride
		);

		console.log(reserves)

		const bobAccountInfoBefore = await (await new AccountBalanceQuery()
			.setAccountId(bobAccount))
			.execute(client);
		console.log(bobAccountInfoBefore.toString())

		reconnectedUniswapV2Router = hethers.ContractFactory.getContract(uniswapV2Router.address, _uniswapV2RouterAbi, bobClientWallet);
		const swapTx = await reconnectedUniswapV2Router.swapExactTokensForTokens(
			500,
			400,
			[tokenContracts[0].evmAddress, tokenContracts[1].evmAddress],
			bobClientWallet.address,
			oneHourAfter.getTime(),
			gasLimitOverride);
		console.log('Waiting for swapTx');
		console.log(swapTx)

		const bobAccountInfoAfter = await (await new AccountBalanceQuery()
			.setAccountId(bobAccount))
			.execute(client);
		console.log(bobAccountInfoAfter.toString())

		const reservesAfter = await reconnectedUniswapV2Router.getReserves(
			tokenContracts[0].evmAddress,
			tokenContracts[1].evmAddress,
			gasLimitOverride
		);

		console.log(reservesAfter)
	} catch (error) {
		console.log(`Adding liquidity + swap failed:`);
		console.log(error);
	}
})();

